import React, {Component} from 'react';
import './App.css';

class Footer extends Component {  

  render() {

    return (
      <div className="Footer">

        <div className="social-container">
          <h2>Social</h2>
        </div>
        <div className="address-container">
          <h2>Address</h2>
        </div>
      </div>

    )
  }

}

export default Footer;
